import keras
import random
from keras.datasets import mnist
from keras.layers import Conv2D, MaxPooling2D
from keras.layers import Dense, Flatten
from keras.models import Sequential

(x_train, y_train), (x_test, y_test) = mnist.load_data()
# seeds_index = []  #[183, 528, 787, 96, 997, 6, 345, 286, 845, 689]
# seeds_value = []  #[2, 63, 27, 73, 82, 53, 46, 10, 34, 96]
# for i in range(10):
#     seeds_index.append(random.randint(1,1000))
# for i in range(10):
#     seeds_value.append(random.randint(1,100))
# print(seeds_value)
# print(seeds_index)
labeledIndex = []
random.seed(689)
for i in range(600):
    labeledIndex.append(random.randint(0,59999))
print(labeledIndex)
random.seed(96)
labeledValue = []
for i in range(600):
    labeledValue.append(random.randint(0,9))
print(labeledValue)

for i in range(600):
    k = y_train[labeledIndex[i]]
    while y_train[labeledIndex[i]] == labeledValue[i]:
        labeledValue[i] = random.randint(0,9)
    y_train[labeledIndex[i]] = labeledValue[i]
    if(k != y_train[labeledIndex[i]]):
        print("Label Error Successfully!!!")
    else:
        print("Label Error Unsuccessfully!!!")


# 输入数据为 mnist 数据集
x_train = x_train.astype('float32').reshape(-1,28,28,1)
x_test = x_test.astype('float32').reshape(-1,28,28,1)


x_train = x_train / 255
x_test = x_test / 255


print('Train:{},Test:{}'.format(len(x_train),len(x_test)))
y_train = keras.utils.to_categorical(y_train, 10)
y_test = keras.utils.to_categorical(y_test, 10)


model = Sequential()
model.add(Conv2D(filters=32, kernel_size=(3, 3), activation='relu',padding='valid', input_shape=(28, 28, 1)))
model.add(Conv2D(filters=32, kernel_size=(3, 3), activation='relu',padding='valid'))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Conv2D(filters=64, kernel_size=(3, 3),padding='valid', activation='relu'))
model.add(Conv2D(filters=64, kernel_size=(3, 3),padding='valid', activation='relu'))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Flatten())
model.add(Dense(200, activation='relu'))
model.add(Dense(10, activation='softmax'))
model.summary()

model.compile(loss='categorical_crossentropy', optimizer='sgd', metrics=['accuracy'])
model.fit(x_train, y_train, batch_size=128, epochs=20, verbose=1,shuffle=False)
score = model.evaluate(x_test, y_test)
print('Test Loss: %.4f' % score[0])
print('Test accuracy: %.4f'% score[1])
model.save('ModelB_LE9.hdf5')

